import React from 'react';
import './App.css';
import SiteHeader from './components/SiteHeader';
import HomepageImage from './components/HomepageImage';

function App() {
  return (
    <div >
      <SiteHeader/>
      <header className="App-header">

        <HomepageImage />



      </header>
    </div>
  );
}

export default App;
